import React from "react";
import AMINE_STAMBOULI_CV from "../images/AMINE_STAMBOULI_CV.PDF";
import photo_amine from "../images/photo_amine.png";
import pdf from "../images/pdf.png";

const Accueil = () => {
    return (
        <div className="accueil">
            <div className="profile_pro">

                <h1 style={{ color: "coral", fontSize: "xx-large" }}>AMINE STAMBOULI</h1>
                <h1>Develloppeur web React JS/ Node JS</h1>
                <div className="profile">
                    <div style = {{border: "2px solid yellow"}}>
                        <p>
                            Après un parcours de 5 ans en tant que cogérant, dont 4 ans dans le<br />
                            commerce ambulant et 1 an dans la restauration. Mon projet<br />
                            professionnel est de m'orienter vers un domaine qui me passionne<br />
                            énormément, qui est le développement web et mobile.Depuis début 2019<br />
                            j'ai commencé à suivre des cours et à m'auto-former à la profession<br />
                            grâce à des formations en ligne (Udemy, Openclassrooms .etc)<br />
                            Actuellement je suis en formation développeur React JS/Node JS, à la <br />
                            Wild Code School de Lyon.
                    </p>
                    </div>
                    <div style = {{border: "2px solid yellow"}}>
                        <img
                            style={{ marginBottom: "40%" }}
                            src={photo_amine}
                            alt="photo de profile"
                        />
                    </div>
                </div>


            </div>
            <div>
                <a href={AMINE_STAMBOULI_CV} target="_blank" rel="noopener noreferrer">
                    <button
                        style={{
                            position: "absolute",
                            top: "70%",
                            left: "77%",
                            width: "250px",
                        }}
                    >
                        <img src={pdf} style={{ width: "5%" }} />
                     Télécharger le CV
                    </button>
                </a>
            </div>

        </div>
    );
};

export default Accueil;
